import React from 'react';
import Home from './components/home'; // Import your Home component
import Resume from './components/Resume';

<nav
  style={{
    display: 'flex',
    justifyContent: 'center',
    padding: '10px',
    backgroundColor: '#333',
  }}
>
  <a
    href="#home"
    style={{
      color: 'white',
      textDecoration: 'none',
      margin: '0 15px',
      fontSize: '16px',
    }}
  >
    Home
  </a>
  <a
    href="#resume"
    style={{
      color: 'white',
      textDecoration: 'none',
      margin: '0 15px',
      fontSize: '16px',
    }}
  >
    Resume
  </a>
  <a
    href="#contact"
    style={{
      color: 'white',
      textDecoration: 'none',
      margin: '0 15px',
      fontSize: '16px',
    }}
  >
    Contact
  </a>
</nav>

function App() {
  return (
    <div>
      <Home />
      <Resume />
    </div>
  );
}



<button
  onClick={() => alert('Thanks for visiting my website!')}
  style={{
    padding: '10px 20px',
    fontSize: '16px',
    color: 'white',
    backgroundColor: '#007bff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    marginTop: '20px',
  }}
>
  Click Me!
</button>

export default App;
